import React from 'react';

import SearchPanel from './components/SearchPanel';
import WeatherContainer from './components/WeatherContainer';

class App extends React.Component {
  render() {
    return (
      <div className="weather-container">
        <SearchPanel />
        <WeatherContainer />
        <WeatherContainer />
        <WeatherContainer />
        <WeatherContainer />
        <WeatherContainer />
      </div>
    );
  }
}

export default App;
